                const link = await (await fetch('/juliahub')).text();
                if (window.origin.endsWith(link)) {
                  const sessionKeepAliveIframe = document.createElement('iframe');
                  sessionKeepAliveIframe.src = 'https://' + link + '/keepalive.html';
                  sessionKeepAliveIframe.title = 'Session Keepalive for JuliaHub';
                  sessionKeepAliveIframe.style= 'position: absolute;left: -5000px;top:-100px';
                  sessionKeepAliveIframe.width = 0;
                  sessionKeepAliveIframe.height = 0;
                  sessionKeepAliveIframe.sandbox =
                    'allow-popups allow-scripts allow-popups-to-escape-sandbox allow-same-origin allow-modals';
                  document.body.append(sessionKeepAliveIframe);
                }
                const keepalive = async () => {
                  try {
                    await (await fetch('/juliahub/keepalive')).json();
                    haveOpenWindow = false
                    if (w && w.close) w.close()
                  } catch (e) {
                    console.error(`Session keepalive ping failed`, e);
                    if (window.location.host.includes(link) && !haveOpenWindow) {
                      const result = confirm('Authentication expired. Please login again.')
                      if (result) {
                        haveOpenWindow = true
                        w = window.open('https://' + link + '/boxed_auth', '_blank')
                      }
                    }
                  }
                };
                setInterval(keepalive, 120 * 1000);
              })();
            </script></head>
